import React, { useState, useEffect } from 'react';
import './App.css';
import Home from './Home/Home';
import Index from './Infor/Index';
import YourCart from './YourCart/YourCart';
import { Routes, Route } from "react-router-dom";
import Login from './Accout/Login';
import Allsp from './AllSp/Allsp';
import SearchCpn from "./Search/Search";


function App() {
  const [login, setLogin] = useState(false)


  return (
    <Routes>
      <Route path="/" element={<Home login={login} />} />
      <Route path="/infor/:id" element={<Index login={login} />} />
      <Route path="/accout" element={<Login login={login} />} />
      <Route path="/cart" element={<YourCart login={login} />} />
      <Route path="/allsp/:type" element={<Allsp login={login} />} />
      <Route path="/search" element={<SearchCpn login={login} />} />
    </Routes>

  )
}

export default App;
